export type WorkOrder = {
    id: string;
    job_type: "delivery" | "enterprise_install" | "rescue" | "parcel_pickup" | "airport_dropoff" | "heavy_pickup";
    due_date: string;
    status: "request_received" | "initializing" | "in_progress" | "failed";
    origin_address: WorkOrderAddress | null;
    destination_address: WorkOrderAddress;
    external_organization: string | null;
    updated_at: string;
    created_at: string;
};
export type WorkOrderAddress = {
    id: string;
    address: string;
    address_two: string | null;
    city: string;
    province: string;
    country: string;
    postal_code: string;
    nickname: string | null;
    notes: string | null;
};
